import React from 'react';
import Media1 from '../components/Media1';
import MapBe from '../components/MapBe'
import { Col, Row } from 'react-bootstrap';


function Home() {
    return (

        <Row>
            <Col sm={8} style={{ margin: '2px 0' }}><MapBe /></Col>

            <Col sm={4} style={{ overflowY: ' scroll', backgroundColor: 'lightblue', height: '600px', margin: '0px 0' }}>
                <Media1 />

            </Col>
        </Row>


    );
}

export default Home;
